import React from 'react'
import { Jumbotron, Card } from 'react-bootstrap'

const features = () => {
    return (
        <div>
            <Jumbotron><h1>Features</h1></Jumbotron>
            <Card>
                <Card.Body>Advertisement for website</Card.Body>
            </Card>
        </div>
    )
}
